import React from "react";
import { Collapse } from "reactstrap";

const Navigator=()=>{

    return(
   <div>
    <nav>
        <Collapse>
      <ul>
        <li><a href="#">Home</a></li>
        <li><a href="#">About</a></li>
        <li><a href="#">Services</a></li>
        <li><a href="#">Contact</a></li>
      </ul>
      </Collapse>
    </nav>

   </div>

    );
}
export default Navigator;
